import { useState, useEffect } from "react";

function Effect(){
    let [count,setCount]=useState(0);
    useEffect(function(){
        console.log("Mounted");
    },[count])
    function increament(){
        setCount(count+1);
    }
    function decreament() {
        setCount(count - 1);
    }
    return (
        <div>
            <button onClick={increament}>
                <p>
                    "+"
                </p>
            </button>
            <button onClick={decreament}>
                <p>
                    "-"
                </p>
            </button>
        </div>
    );
}

export default Effect;
